import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
	return (
		<header>
			<div className="ek-navbar">
				<div className="ek-navbar__logo">
					<Link to="/">Eksho</Link>
				</div>
				<div className="ek-navbar__menu">
					<ul>
						<li>
							<Link to="/offer">Offer</Link>
						</li>
					</ul>
				</div>
			</div>
		</header>
	);
};

export default Header;
